import Card from "../UI/Card";

import classes from "./UsersList.module.css";

const UsersList = props => {
  return (
    <Card className={classes.users}>
      <ul>
        {props.items.map(goal => (
          <CourseGoalItem
            key={goal.id}
            id={goal.id}
            onDelete={props.onDeleteItem}
          >
            {goal.text}
          </CourseGoalItem>
        ))}
      </ul>
    </Card>
  )
};

export default UsersList;


